import cT from "./create-tile";

const initializeBoard = (): any => {
  return [
    [cT(false), cT(true), cT(false), cT(true), cT(false), cT(true), cT(false), cT(true)],
    [cT(true), cT(false), cT(true), cT(false), cT(true), cT(false), cT(true), cT(false)],
  ]
};

export default initializeBoard;
